import styles from './Main.module.css';

function Main() {
  return (
    <main>
      {/* ドット絵背景セクション */}
      <section className={styles.fullscreenSection}>
        <h1>Piyoppi</h1>
        <p>Portfolio</p>
      </section>

      {/* 続きのコンテンツ */}
      <section className={styles.contentSection}>
        <h2>次のセクションへようこそ</h2>
        <p>この部分にサイトの紹介や詳細を入れましょう。</p>
      </section>
    </main>
  );
}

export default Main;
